import React from 'react';
// import './Links.css';
import PropTypes from 'prop-types';


const DisplayLinks = ({ linkData }) => {

  console.log("link object: "+linkData[0]);
  // Check if linkData exists and is an array
  if (!Array.isArray(linkData)) {
    console.error("Invalid data format for linkData. Expected an array.");
    return null; // Return null if linkData is invalid
  }

  return (
    <div className="links-content">
      {linkData.map((linkItem, index) => (
        <React.Fragment key={index}>
          <a 
            href={linkItem.link} 
            target="_blank" 
            rel="noopener noreferrer"
          >
            {linkItem.title}
          </a>
          {index < linkData.length - 1 && ', '}
        </React.Fragment>
      ))}
    </div>
  );
};

DisplayLinks.propTypes = {
  linkData: PropTypes.arrayOf(
    PropTypes.shape({
      link: PropTypes.string.isRequired,
      title: PropTypes.string.isRequired,
    })
  ).isRequired,
};

DisplayLinks.defaultProps = {
  linkData: [] // Default to an empty array if no linkData is provided
};

export default DisplayLinks;
